working = former.split("},{")
working.pop()

class rating():

    def __init__(self, order, date, approve, disapprove):
        self.order = order
        self.date = date
        self.approve = approve
        self.disapprove = disapprove

    def say_data(self):
        print (str(self.date) + " " + str(self.approve) + "% " + str(self.disapprove) + "%")

x = rating(0, "5-12-15", 55.333, 45.333)

middle = []
new = []
inc = 0

for n in working:
    apart = n.split(",")
    f = apart[1]
    if f == '"future":false':
        da = apart[0]
        a = apart[3]
        ds = apart[6]
        all = [da, a, ds]
        middle.append(all)

for n in middle:
    inc += 1
    da_old = ''.join(filter(str.isdigit, str(n[0])))
    da = str(da_old[0:4] + "-" + da_old[4:6] + "-" + da_old[6:8])
    a_old = ''.join(filter(str.isdigit, str(n[1])))
    a = float(str(a_old[0:2] + "." + a_old[2:]))
    ds_old = ''.join(filter(str.isdigit, str(n[2])))
    ds = float(str(ds_old[0:2] + "." + ds_old[2:]))
    all = [inc, da, a, ds]
    new.append(all)

order = []
approve = []
disapprove = []
for n in new:
    order.append(n[0])
    approve.append(n[2])
    disapprove.append(n[3])

import matplotlib.pyplot as plt

plt.plot(order,approve,disapprove)
plt.title('Joe Biden Approval Rating from 538')
plt.xlabel('Days')
plt.ylabel('Rating as Percent')